import React from 'react';
import styled from 'styled-components';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 200vh;
  width: 100vw;
`;

function SlideTwo() {
  return (
      <StyledSlideTwo>
        <CarInfoDisplay />
        <div className='StickyText-trigger-1' />
      </StyledSlideTwo>
  );
}

export default SlideTwo;
